package main

import (
	"testing"

	"github.com/stretchr/testify/assert"
)

func TestJumps(t *testing.T) {
	tests := []struct {
		name    string
		inp     string
		minJump int
		maxJump int
		res     bool
	}{
		{
			name:    "Example 1",
			inp:     "011010",
			minJump: 2,
			maxJump: 3,
			res:     true,
		},
		{
			name:    "Example 2",
			inp:     "01101110",
			minJump: 2,
			maxJump: 3,
			res:     false,
		},
		{
			name:    "Example 3",
			inp:     "",
			minJump: 2,
			maxJump: 99998,
			res:     true,
		},
	}

	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {

			assert.Equal(t, tt.res, canReach(tt.inp, tt.minJump, tt.maxJump), tt.name)
		})
	}
}
